import MobileProfile from './mobile_profile/MobileProfile';

//import all the pages created in the frontend FOR MOBILE



function App() {
  return (
    //add routes for each page created in the frontend
    <Router>
      <Routes>

        <Route path="/" element={<MobileProfile />} />
        {/*
